import Navbar from "../Component/Navbar";
import React, { useEffect, useState } from "react";


const Home = () => {

    const [takım, SetTakımlar] = useState([])


    useEffect(() => {
        const api_link = "https://cryptic-gorge-72989.herokuapp.com/teams"
        fetch(api_link)
            .then(takım => takım.json())
            .then(takım => {
                SetTakımlar(takım)
            })
    }, [])

    return (
        <div>
            <Navbar />
            <hr/>
            {
                takım.map(takım=>
                    <div>
                        <h1>{takım.name}</h1>
                    </div>
                    )
            }
        </div>
    )
}

export default Home;
